import React, {Component, ReactNode} from 'react';
//import {resolveImagePath} from '../../Utilities';
import { EditorState, RichUtils,Modifier,AtomicBlockUtils } from 'draft-js';
import Editor from '@draft-js-plugins/editor';
import createImagePlugin from '@draft-js-plugins/image';
import style from './Stylesheet/style.module.scss';
const imagePlugin = createImagePlugin();
interface props{

}

interface state{
	editorState:any
}

export default class WYSIWYG extends Component<props,state>{
	constructor(props) {
		super(props);
		this.state = {editorState: EditorState.createEmpty()};
		console.log(style);
	}
	render():ReactNode{
		return <div>
			{this.renderControls()}
			<div className="wysiwyg">
				<Editor 
					editorState={this.state.editorState} 
					onChange={this.handleChange.bind(this)}
					plugins={[imagePlugin]}
					handleKeyCommand={this.handleKeyCommand.bind(this)}	
				/>
			</div>
		</div>

	}

	renderControls():ReactNode{
		return <div className="px-2">
			<button className={style.button} onClick={this._onBoldClick.bind(this)}>Bold</button>
			<button className={style.button} onClick={this._onItalicsClick.bind(this)}>Italics</button>
			<button className={style.button} onClick={this._onUnderlineClick.bind(this)}>UnderLine</button>
			<button className={style.button} onClick={this._onBoldClick.bind(this)}>Link</button>
			<button className={style.button} onClick={this._onImageClick.bind(this)}>Image</button>
			<button className={style.button} onClick={this._onBoldClick.bind(this)}>Bold</button>
			<button className={style.button} onClick={this._onBoldClick.bind(this)}>Bold</button>
		</div>
		
	}
	
	handleChange(editorState){
		this.setState({editorState});
	}

	handleKeyCommand(command, editorState) {
		const newState = RichUtils.handleKeyCommand(editorState, command);
	
		if (newState) {
		  this.handleChange(newState);
		  return 'handled';
		}
	
		return 'not-handled';
	}

	_onBoldClick() {
		this.handleChange(RichUtils.toggleInlineStyle(this.state.editorState, 'BOLD'));
	}
	_onItalicsClick() {
		this.handleChange(RichUtils.toggleInlineStyle(this.state.editorState, 'ITALIC'));
	}
	_onUnderlineClick() {
		this.handleChange(RichUtils.toggleInlineStyle(this.state.editorState, 'UNDERLINE'));
	}


	_onImageClick(){
		const newEditorState = this.insertImage(this.state.editorState, this.sampleBase64());
		this.setState({ editorState: newEditorState });
		/*var editorState = this.state.editorState;
		var selectionState = editorState.getSelection();
		const contentState = editorState.getCurrentContent();
		const contentStateWithEntity = contentState.createEntity('IMAGE', 'IMMUTABLE', {
		  url: this.sampleBase64(),
		});
		const entityKey = contentStateWithEntity.getLastCreatedEntityKey();
		const contentStateWithLink = Modifier.applyEntity(
		  contentStateWithEntity,
		  selectionState,
		  entityKey,
		);
		const newEditorState = EditorState.set(editorState, {
		  currentContent: contentStateWithLink,
		});
		console.log(editorState,newEditorState)
		this.handleChange(newEditorState);*/
	}

	insertImage(editorState,url){
		const contentState = editorState.getCurrentContent();
		const contentStateWithEntity = contentState.createEntity(
		  'image',
		  'IMMUTABLE',
		  { src: url },
		);
		console.log(url);
		const entityKey = contentStateWithEntity.getLastCreatedEntityKey();
		const newEditorState = EditorState.set(
		  editorState,
		  { currentContent: contentStateWithEntity },
		);
		return AtomicBlockUtils.insertAtomicBlock(newEditorState, entityKey, ' ');
	}

	sampleBase64(){
		return `data:image/png;base64,`
	}

}